Program: |+1
 // Method Tasks:
 // Check the parameter of the store. We have to test if all four cornerpoints of
 // the store can be reached by the portal.
 //
 // Parameters	: Crane, the MultiportalCrane
 //
 // ReturnValues : none
 //
 // Called By	: INIT
 // Calls		: none
 //--------------------------------------------------------------------------------
 param Crane : object
 
 var Portal := Crane.Portal1
 
 var store := crane.assignedStore
 
 //--------------------------------------------------------------------------------
 // check point Store[1,1]
 
 var StorePos11 : real[3] := crane._3D.getPositionOfObject(Store, Store._3D.getMUAnimationPosition(1, 1))
 
 var CranePosition : real[3] := Crane.calculateTargetPosition(Portal, StorePos11)
 var PositionOK : integer := Crane.checkCraneCoordinates(POrtal, CranePosition, false)
 
 if positionOK>0 then
 	var message : string := "Position (1/1) of the Store cannot be reached."
 	throwRuntimeError(message)
 end
 
 //--------------------------------------------------------------------------------
 // check point Store[1, YDim]
 
 var StorePos1YDim := crane._3D.getPositionOfObject(Store, store._3D.getMUAnimationPosition(1, store.YDim))
 
 CranePosition := Crane.calculateTargetPosition(Portal, StorePos1YDim)
 
 PositionOK := Crane.checkCraneCoordinates(Portal, CranePosition, false)
 if PositionOK>0 then
 	message := to_str("Position (1/", store.YDim, ") of the Store cannot be reached.")
 	throwRuntimeError(message)
 end
 
 //--------------------------------------------------------------------------------
 // check point Store[XDim, 1]
 
 var StorePosXDim1 := crane._3D.getPositionOfObject(Store, store._3D.getMUAnimationPosition(Store.XDim, 1))
 
 CranePosition := Crane.calculateTargetPosition(Portal, StorePosXDim1)
 
 PositionOK := Crane.checkCraneCoordinates(Portal, CranePosition, false)
 if positionOK>0 then
 	message := to_str("Position (", store.XDim, "/1) of the Store cannot be reached.")
 	throwRuntimeError(message)
 end
 
 //--------------------------------------------------------------------------------
 // check point Store[XDim, YDim]
 
 var StorePosXDimYDim := crane._3D.getPositionOfObject(Store, store._3D.getMUAnimationPosition(store.XDim, store.YDim))
 
 CranePosition := Crane.calculateTargetPosition(Portal, StorePosXDimYDim)
 
 PositionOK := Crane.checkCraneCoordinates(Portal, CranePosition, false)
 if positionOK>0 then
 	message := to_str("Position (", store.XDim, "/", store.XDim, ") of the Store cannot be reached.")
 	throwRuntimeError(message)
 end
 
 // set the portals of the store
 // currently storing portal and removing portal are the same. Maybe in a later
 // version we will have different portals
 
 Store.StoringPortal := Crane.Portal1
 Store.RemovingPortal := Crane.Portal1
